import React from "react";

export default function photos(props) {
    if (props.photos) {
        return (
        <section className="Photos">
            <div className="row"></div>
            {props.photos.map(function(photo,index){
                return <img src={photo.src.tiny} key={index} alt=" " />;
            })}
        </section>);
    } else {
        return null;
    }
}
